import { useState, useEffect, useRef } from "react";
import Lottie from "lottie-react";
import "../../styles/ApplyToday.css";
import characterAnim from "../../assets/animations/character.json";

function ApplyToday() {
  const [form, setForm] = useState({
    firstName: "",
    middleName: "",
    lastName: "",
    suffix: "",
    ssn: "",
    dob: "",
    address1: "",
    address2: "",
    country: "United States",
    city: "",
    state: "",
    zip: "",
    residence3yrs: "",
    primaryPhone: "",
    cellPhone: "",
    email: "",
    confirmEmail: "",
    consent: false,
    license: ""
  });

  const [loading, setLoading] = useState(false);
  const [message, setMessage] = useState("");
  const [speech, setSpeech] = useState("ðŸ‘‹ Hi! Please start filling the form");
  const lottieRef = useRef();

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setForm({ ...form, [name]: type === "checkbox" ? checked : value });
    setSpeech(`âœï¸ Filling ${name.replace(/([A-Z])/g, " $1")}`);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    if (form.email !== form.confirmEmail) {
      setSpeech("âŒ Emails donâ€™t match");
      lottieRef.current?.setDirection(-1);
      lottieRef.current?.play();
      alert("Email addresses do not match");
      return;
    }

    if (!form.consent) {
      setSpeech("âš ï¸ Please give consent");
      alert("Please provide consent to proceed");
      return;
    }

    try {
      setLoading(true);
      setMessage("");
      setSpeech("â³ Submitting your application...");

      const res = await fetch("http://localhost:5000/apply", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(form)
      });

      if (!res.ok) throw new Error("Failed");

      setSpeech("ðŸŽ‰ Success! Welcome to RGM Family!");
      lottieRef.current?.play();

      setMessage(
        "âœ… Application submitted successfully! Our team will contact you shortly for your virtual meeting."
      );

      setForm({
        firstName: "",
        middleName: "",
        lastName: "",
        suffix: "",
        ssn: "",
        dob: "",
        address1: "",
        address2: "",
        country: "United States",
        city: "",
        state: "",
        zip: "",
        residence3yrs: "",
        primaryPhone: "",
        cellPhone: "",
        email: "",
        confirmEmail: "",
        consent: false,
        license: ""
      });
    } catch {
      setSpeech("âŒ Something went wrong");
      setMessage("âŒ Something went wrong. Please try again later.");
    } finally {
      setLoading(false);
    }
  };

  // ðŸ‘ Eyes follow cursor illusion
  useEffect(() => {
    const move = () => lottieRef.current?.setSpeed(1);
    window.addEventListener("mousemove", move);
    return () => window.removeEventListener("mousemove", move);
  }, []);

  return (
    <div className="apply-container with-character">
      
      {/* CHARACTER */}
      <div className="character-box">
        <Lottie
          lottieRef={lottieRef}
          animationData={characterAnim}
          loop
          autoplay
          style={{ width: 260 }}
        />
        <div className="speech-bubble">{speech}</div>
      </div>

      {/* FORM (UNCHANGED) */}
      <div className="form-wrapper">
        <h1>Apply Today â€“ Join the RGM Family</h1>
        <p>
          Thank you for your interest in <strong>RGM Family</strong>. Please
          complete the application below. Incomplete applications may delay processing.
        </p>

        <form className="apply-form" onSubmit={handleSubmit}>
          {/* ALL YOUR SECTIONS EXACTLY SAME */}
          {/* (unchanged from your code) */}

          {/* ... your existing form code stays as-is ... */}

          {message && <div className="form-message">{message}</div>}

          <button
            className="submit-btn full"
            type="submit"
            disabled={loading}
            onMouseEnter={() => setSpeech("ðŸ‘‹ Ready to submit?")}
          >
            {loading ? "Submitting..." : "Submit Application & Request Meeting"}
          </button>
        </form>
      </div>
    </div>
  );
}

export default ApplyToday;
